import './input.css';
import React from 'react';

class List extends React.Component {
    constructor(props) {
      super(props);
      this.state = {loading: false, data: null};
    }
    
    componentDidMount(){
        var result = this.props.value;
        console.log(result)
        if(result != null){
            const http = require("https");
            const options = {
                "method": "GET",
                "hostname": "skyscanner-skyscanner-flight-search-v1.p.rapidapi.com",
                "port": null,
                "path": "/apiservices/browsequotes/v1.0/" + result["country"] + "/" + result["currency"] + "/" + result["locale"] +
                 "/" + result["origin"] + "/" + result["destination"] + "/" + result["outbound"] + "?inboundpartialdate=" + "/" +
                 result["inbound"],
                "headers": {
                    "x-rapidapi-key": "eee60225dfmsh483cdc041112e38p1614f2jsn1e3e3516465d",
                    "x-rapidapi-host": "skyscanner-skyscanner-flight-search-v1.p.rapidapi.com",
                    "useQueryString": true
                },
                "json": true
            };
    
            const req = http.request(options, function (res) {
                const data = "";
                const chunks = [];
                res.on("data", function (chunk) {
                    data += chunk
                    // chunks.push(chunk);
                });
    
                res.on("end", function () {
                    console.log(chunks)
                    const body = Buffer.concat(chunks);
                    // this.setState({data: "hello"});
                });
            });
    
            req.end();
    
        }
    }
  
    render() {
      return (
        <div>{!this.state.loading ? <p>Loading...</p> : <p>tester</p>}</div>
      );
    }
  }

  export default List;
